import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

const Register = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    pnombre: "",
    snombre: "",
    papellido: "",
    sapellido: "",
    identificacion: "",
    email: "",
    fechaNacimiento: "",
    ubicacion: {
      lugar: "",
      ciudad: "",
      departamento: "",
    },
    usuario: {
      login: "",
      password: "",
    },
  });

  const [showModal, setShowModal] = useState(false);
  const [modalMessage, setModalMessage] = useState("");
  const [modalType, setModalType] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.startsWith("usuario.")) {
      const usuarioField = name.split(".")[1];
      setFormData((prevData) => ({
        ...prevData,
        usuario: { ...prevData.usuario, [usuarioField]: value },
      }));
    } else if (name.startsWith("ubicacion.")) {
      const ubicacionField = name.split(".")[1];
      setFormData((prevData) => ({
        ...prevData,
        ubicacion: { ...prevData.ubicacion, [ubicacionField]: value },
      }));
    } else {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // ... validaciones existentes ...

    const dataToSend = {
      ...formData,
      identificacion: parseInt(formData.identificacion),
    };

    try {
      const response = await fetch("http://localhost:9001/Laboratorio1/persona", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(dataToSend),
      });

      // ... manejo de respuesta ...

    } catch (error) {
      console.error("Error:", error);
      setModalMessage("Error en la solicitud.");
      setModalType("error");
      setShowModal(true);
    }
  };

  // ... resto del cÃ³digo ...

  return (
    <div className="container mt-5">
      <div className="card">
        <div className="card-header">
          <h2>Agregar Persona</h2>
        </div>
        <div className="card-body">
          <form onSubmit={handleSubmit}>
            {/* ... campos existentes ... */}
            <h3>UbicaciÃ³n</h3>
            <div className="row mb-3">
              <div className="col-md-4">
                <label className="form-label">Lugar:</label>
                <input
                  type="text"
                  name="ubicacion.lugar"
                  className="form-control"
                  value={formData.ubicacion.lugar}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="col-md-4">
                <label className="form-label">Ciudad:</label>
                <input
                  type="text"
                  name="ubicacion.ciudad"
                  className="form-control"
                  value={formData.ubicacion.ciudad}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="col-md-4">
                <label className="form-label">Departamento:</label>
                <input
                  type="text"
                  name="ubicacion.departamento"
                  className="form-control"
                  value={formData.ubicacion.departamento}
                  onChange={handleChange}
                  required
                />
              </div>
            </div>
            {/* ... resto del formulario ... */}
          </form>
        </div>
      </div>
      {/* ... modal ... */}
    </div>
  );
};

export default Register;
